&quot;The word NURU in Japanese means &quot;slippery&quot;. The Nuru Massage uses a special gel which is made from deep seaweed and is colourless, tasteless and extremely slippery and smooth. The masseuse will rub your entire body with the nuru and slide on you from all imaginable angles for a perfect body to body massage.&quot;

